Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('말티즈', '소형', '적음', '많음', '예민하다', '이탈리아', 'Maltese',
        '말티즈(이탈리아어: Maltese) 혹은 몰티즈는 개 품종 중 하나이다. ''몰티즈''란 이름은 이 개가 지중해의 몰타(이탈리아어: Malta) 섬이 원산지여서 붙여졌다는게 정설이지만, 지중해의 멜리타 지역에서 유래되었다고 주장하는 학자들도 있다. 몸무게는 2~3kg이 평균이지만 큰 종의 경우 5kg까지 된다. 온몸이 순백색의 길고 부드러운 명주실 같은 털로 덮인 매우 아름다운 개로, 새까만 코끝과 어두운 색의 눈이 순백색의 털이 돋보인다. 지중해의 몰타섬이 원산이라고 하여 이 이름이 붙여졌으나, 사실의 기록이나 전승은 전혀 없고 기원도 뚜렷하지 않다. 몰티즈의 원산지가 이탈리아라는 의견도 있다. 1800년 무렵에는 유럽 전역과 미국에 널리 알려졌으며, 아름다운 모습과 온화하고 높은 지능을 지녀 애완용으로 널리 사육되었다. 평균 수명은 15년 정도로 알려져 있다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('포메라니안', '소형', '많음', '많음', '예민하다', '독일', 'Pomeranian',
        '포메라니안(영어: Pomeranian)은 중앙유럽(오늘날 독일 북동부, 폴란드 북서부)에 있는 포메라니아 지역에서 유래된 스피츠 종류의 반려견이다. 작고 귀여운 외모와 복슬복슬한 털이 특징이며 털빠짐이 있다. 작은 크기 때문에 소형견로 분류되는데, 포메라니안은 대형 스피츠종 개인 독일 스피츠에서 유래되었다. 이 때문에 국제애견협회에서도 포메라니안을 독일 스피츠의 일종으로 구분했고, 많은 나라에서 츠베르크슈피츠(Zwergspitz, 난쟁이 스피츠라는 뜻)로 알려져 있다. 또는 폼(Pom), 폼폼(Pom Pom)이라는 이름으로도 불린다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('프렌치 불도그', '소형', '많음', '적음', '온순하다', '프랑스', 'French_Bulldog',
        '프렌치 불도그(French Bulldog)는 프랑스 원산으로 기원은 확실하지 않으나 1860년경 퍼그와 테리어의 교배로 생겨난 것으로 여겨진다. 어깨높이 30cm, 몸무게 10~13kg이다. 커다란 머리와 박쥐처럼 생긴 귀가 특징이다. 털은 짧고 부드러우며 광택이 있다. 몸빛은 흰색 또는 검은색이다. 성격은 활달하고 명랑하며 믿음직스러워 아이들의 친구로서 좋으며 집 지키는 개로서도 적당하다');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('단모 치와와', '소형', '많음', '적음', '예민하다', '멕시코', 'Short_haired_Chihuahua',
        '치와와(Chihuahua)는 개의 품종 중 가장 작은 품종으로 유명하다. 키는 13~22cm, 평균 체중은 1.8~2.7kg이 정상 체중이다. 견종 중 몸집이 가장 큰 그레이트 데인에 비하면 20분의 1밖에 안 되는 셈이다. 귀는 크고 쫑긋하며, 눈은 크고 약간 볼록하게 보인다. 털빛깔은 붉은색, 검은색, 담황색, 얼룩무늬 등 여러 가지가 있다. 원래 털이 매끈매끈한 단모종이다. 장모종도 있는데, 비교적 근래에 포메라니안 등과 교배하면서 생겨나게 되었다.[1] 짜증을 잘 내는 성격으로 유명한 견종이다. 크기가 작고 얼굴형도 무난하여 교배종으로도 인기가 많다.[2] 사회성이 낮아 주인과 친해지면 집착하는 성향이 높다. 순한 단모나 장모치와와는 뒤집혀서 배를 긁어주는 것을 즐긴다');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('장모 치와와', '소형', '보통', '적음', '예민하다', '멕시코', 'Long_haired_Chihuahua',
        '치와와(Chihuahua)는 개의 품종 중 가장 작은 품종으로 유명하다. 키는 13~22cm, 평균 체중은 1.8~2.7kg이 정상 체중이다. 견종 중 몸집이 가장 큰 그레이트 데인에 비하면 20분의 1밖에 안 되는 셈이다. 귀는 크고 쫑긋하며, 눈은 크고 약간 볼록하게 보인다. 털빛깔은 붉은색, 검은색, 담황색, 얼룩무늬 등 여러 가지가 있다. 원래 털이 매끈매끈한 단모종이다. 장모종도 있는데, 비교적 근래에 포메라니안 등과 교배하면서 생겨나게 되었다.[1] 짜증을 잘 내는 성격으로 유명한 견종이다. 크기가 작고 얼굴형도 무난하여 교배종으로도 인기가 많다.[2] 사회성이 낮아 주인과 친해지면 집착하는 성향이 높다. 순한 단모나 장모치와와는 뒤집혀서 배를 긁어주는 것을 즐긴다');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('비글', '소형', '많음', '많음', '활발하다', '영국', 'Beagle',
        '하운드 중에서도 가장 작은 견종이다. 이 계통의 견종은 매우 오랜 역사를 가지고 있으며, 기원전부터 그리스에서 토끼 사냥에 이용되었던 하운드의 후예라고 한다. 엘리자베스 여왕 2세(1533~ 1603년)시대, 영국에는 이 타입의 대소 두 종류의 하운드가 있었으며, 작은 하운드를 프랑스어의 “작다”라고 하는 의미의 비글이라고 하며, 산토끼 사냥에 이용하였다. 예민한 후각은 블러드 하운드의 혈통을 이어 받았기 때문이라고 전해진다. 수렵견, 가정견.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('요크셔테리어', '소형', '적음', '많음', '예민하다', '영국', 'Yorkshire_Terrier',
        '요크셔 테리어(영어: Yorkshire terrier)는 영국의 개 품종 중의 하나이며, 한때 노동자들이 기르던 개이며, 쥐잡기용 강아지로 인기가 높았던 애완견이다. 털의 색깔은 머리와 사지만 짙은 황갈색이고, 그 외의 다른 부위는 감청색 계통이다. 별명으로는 ''요키'', ''요크''가 있다.  그리고 성격은 사는 환경에 따라 달라지며 온순한 성격과 천진난방한 성격 두가지 중에 하나를 가지고 있다 크기는 20~23cm이고, 몸무게는 3kg 전후, 최대 3.2 킬로그램(7파운드)[1]이며, 움직이는 보석이라는 별칭을 가지고 있다. 그 외에도 고양이와 비슷하게 쥐를 사냥하거나 잡아먹는 경우도 있다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('닥스훈트', '소형', '보통', '많음', '활발하다', '독일', 'Dachshund',
        '바셋 하운드와 같이 스위스의 쥬라 산악지방의 쥬라 하운드가 조상견이라 하며 독일, 오스트랄리아의 산악지대에 있던 중형 핀셔와의 교잡에 의해서 오늘날의 기초견이 만들어졌다고 전해진다.(스무스 헤어드 견종) 당시에는 체중 10~20 Kg 정도로 컸었던 듯하며, 슈나이져를 교배하고 그 밖의 테리어에 의해서 와이어 헤어드 종이 만들어졌다. 또한 롱 헤어드 견종은 15세기경 스파니엘과의 교잡에 의해 만들어졌으나 어디에서 만들어졌는지는 알 수 없다. 오소리의 수렵견(닥스훈드)라고 이름 지어졌다. 미니츄어 닥스훈드는 스탠다드 닥스훈드가 들어갈 수 없는 작은 굴에 들어가 수렵 할 수 있도록 소형의 크기로 개량된 것으로 그 역사는 아직 짧다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('퍼그', '소형', '많음', '적음', '온순하다', '중국', 'Pug',
        '퍼그는 10에서 11인치까지 크며 체중은 14에서 18 파운드까지 나간다 (6에서 8 킬로그램). 그들은 각진 체격에 튼튼한 다리를 가졌다. 퍼그는 마스티프 혈통에 알맞게 작은 반려견 중에 가장 튼튼하다.  퍼그는 크고 둥글고 눌러진듯한 얼굴과 이마에 많은 주름 때문에 많이 알려져 있다. 이마에 수평 주름이 중국의 "왕자" 한자와 유사해서 주름이 "왕자의 상징"이라고 알려져 있다. 눈이 어느 정도 돌출 되어 있어서 트라우마에 노출되어있다. 꼬리는 허리 위로 살짝 구부러졌다.  그들은 매우 짧지만 아주 두꺼운 이중 털을 가졌다. 색은 살구색에서 엷은 황갈색, 은색과 검정색까지 있다. 검정색 종을 제외한 모든 종이 어두운 색의 얼굴과 눈이며 등 부위에 살짝 어두워지는 부분이 있다. 귀는 마치 검은 벨벳과 같은 촉감이다. ');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('시츄', '소형', '적음', '적음', '온순하다', '중국', 'Shih_Tzu',
        '시추(차모로어: Chichu)[1]는 중국에서 비롯한 개 품종이며 과거 중국 황실이 기르던 견종이다. 중국에서는 ‘사자개(중국어 간체자: ?子狗, 정체자: 獅子狗, 병음: Sh?zi G?u 스쯔거우[*])’라고 부르는데, 이 이름의 웨이드식 로마자 표기법인 shih-tzu kou에서 ‘시추’라는 이름이 전해졌다. 중국 티베트 지역이 원산으로 7세기 무렵 왕실에서 길러졌으며 서구에는 1930년경 알려졌다. 어깨높이 23~27cm, 몸무게 4~7.5kg이다. 길고 화려한 털이 특징으로 꼬리를 높이 세우고 당당하게 걷는 자태는 볼 만하다. 성격이 사교적이고 친근하고 영리하여 가정견으로서 인기가 높다. 하지만 ''식탐''이 좀 많은 편이며 가끔 고집을 부리기도 한다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('토이 푸들', '소형', '적음', '많음', '활발하다', '독일', 'Toy_Poodle',
        '토이푸들을 구별하는 기준은 2가지가 있는데, 미국(AKC, UKC), 캐나다, 한국 등의 애견협회에서는 25.4cm(=10인치)까지, 영국, 프랑스 등에서는 24~28cm까지를 토이푸들로 인정한다. 미국, 캐나다, 우리나라 기준인 25.4cm 미만의 토이푸들은 실제로는 상당히 드물며, 대부분이 미니어처 푸들이다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('시바견', '소형', '많음', '많음', '활발하다', '일본', 'Shiba_Inu',
        '일본이 원산지인 개의 한 품종이며 일본에서 많이 기르는 견종 가운데 하나이다. 일본의 천연기념물로 지정된 6종의 일본견종 중 하나다. 6종의 일본 전통 견종 중 약 80%가 시바견이라고 한다. 매체상으로는 일본의 다른 전통 견종이자 국견인 아키타견이 더 많이 언급되었지만 닌텐독스 같은 2000년대 이후 비교적 최근의 반려견 관련 컨텐츠에서는 점차 시바견 쪽을 우대하고 있는 것 같다. 전세계적으로 가장 인지도가 높은 일본견이기도 하다. 한국에서는 일본견 하면 아키타견이었고 잘 알려지지 않은 품종이었으나 2010년대부터 각종 밈이나 유행을 통해 알려지며 지금은 가장 인지도가 높은 견종이 되었다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('풍산개', '소형', '많음', '많음', '온순하다', '한국', 'Pungsan_Dog',
        '풍산개(?山-)는 개의 품종 중 하나로, 한국의 대표적인 사냥개이다. 겉모습은 진돗개와 비슷하나, 추운 날씨에 적응하여 털이 굵고 몸이 다부지다. 품종명은 함경남도 풍산군(豊山郡)(현 량강도 김형권군)에서 유래하였다. 또한 풍산개는 큰 짐승을 사냥하는 데에 주로 쓰였으며, 한국표범이나 시베리아호랑이 같은 맹수를 사냥하기도 했다. 조선민주주의인민공화국에서는 천연기념물 368호로 지정하였고, 2014년 국견으로 지정하였다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('삽살개', '중형', '보통', '많음', '온순하다', '한국', 'Sapsaree',
        '삽살개는 삽사리라고도 한다. 한반도의 동남부 지역에 널리 서식하던 대한민국의 토종개이다. 키는 수컷이 51cm, 암컷은 49cm이며 생김새는 온몸이 긴털로 덮여 있다. 눈은 털에 가려서 보이지 않는다. 귀는 누웠으며 주둥이는 비교적 뭉툭하여 진돗개처럼 뾰족하지 않다. 꼬리는 들려 올라가며 머리가 커서 그 모습이 꼭 사자를 닮았다. 성격은 대담하고 용맹하며, 주인에게 충성스럽지만 주인을 무는 경우도 있다. ‘귀신과 액운을 쫓는 개’라는 뜻을 지닌 삽살개는 이름 자체도 순수한 한국어로서 가사 민담, 그림 속에 자주 등장한다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('비숑프리제', '중형', '적음', '많음', '온순하다', '프랑스', 'Bichon_Frise',
        '주로 흰색의 곱슬거리는 털을 가진 프랑스와 벨기에 그리고 스위스 원산의 개로서, 곱슬한 털이 자라면서 얼굴이 동그란 형태가 되는 것이 특징이다. 견종의 성격은 독립심이 강하며 세심하고 활발하다고 알려져있으나, 모든 강아지가 그러하듯 개별적으로 다양한 성격을 가진 것으로 보인다. 동그란 얼굴과 까만 코와 눈이 아름답게 조화를 이루는 외모로 털이 곱슬거리고 아름다운 만큼 관리가 까다롭다. 식성이 엄청나고 활발한 성격탓에 흥분을 잘한다. 어릴 때는 집안을 아무 이유없이 미친듯이 뛰어다니는데, 이것을 "비숑 타임"이라고 한다. 비숑타임이 오는 이유는 놀이 후 급격하게 에너지가 상승, 산책을 자주 가지 못해 남아도는 에너지를 이로 소비하기 위해서다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('웰시코기', '중형', '많음', '많음', '활발하다', '영국', 'Welsh_Corgi',
        '웰시 코기(영어: Welsh corgi), 웨일스 귀염둥이(wales 귀염둥이)는[1] 몸통이 길고 다리가 짧은 영국의 웨일스산의 개이다. 웰시 코기는 펨브로크 웰시 코기 와 카디건 웰시 코기, 이 두 가지의 종류로 나뉘는데 펨브로크 종이 더 흔하다. 웰시 코기 카디건과 펨브룩은 귀 크기, 몸집 등으로 알 수 있다. 카디건은 귀 크기와 몸집이 조금 더 크다. 짧고 통통한 다리와 식빵 모양의 엉덩이가 특징이고, 털 색은 갈색, 고동색, 황토색, 검은색, 회색+검은색 점박이 등으로 다양하다. 몸무게는 14~ 17kg정도이다. 활동적이며 운동량이 많고, 털빠짐이 심하고 꼬리를 자른 웰시코기들이 많다. 자르지 않으면, 다리가 짧아서 꼬리가 쓸릴 수도 있기 때문이다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('진돗개', '중형', '많음', '많음', '활발하다', '대한민국', 'Jindo_Dog',
        '진돗개는 대한민국의 원산지입니다. 특히, 전라도 지역에서 오랫동안 기르고 전통적으로 사냥용으로 사용되어 왔습니다. 이 지역에서는 진도 반도와 제주도가 대표적인 진돗개 생산지로 알려져 있습니다. 하지만 현재는 대한민국 전역에서 쉽게 찾아볼 수 있는 개종으로 인기를 얻고 있습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('차우차우', '중형', '많음', '많음', '활발하다', '중국', 'Chow_Chow',
        '차우차우는 중국의 원산지로 추정되고 있습니다. 특히, 산동성 지역에서 기원한 것으로 알려져 있습니다. 차우차우는 고대 중국에서 귀족 계급의 사냥 개로 인기를 끌었으며, 나중에는 일반인들도 기르기 시작하여 현재에 이르러서는 전 세계적으로 인기 있는 개종 중 하나가 되었습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('시베리안 허스키', '중형', '많음', '많음', '활발하다', '러시아', 'Siberian_Husky',
        '시베리안 허스키(Siberian Husky)는 원산지가 시베리아(Siberia)로 추정되는 개 종으로, 푸른색 눈과 살코기가 풍부한 몸매, 그리고 두꺼운 겨울 모피로 유명한 견종입니다. 주로 겨울에 유연한 몸뚱아리와 뛰어난 내열성, 그리고 인내심이 강한 성격으로 인해 썰매견으로 사용되었으며, 오늘날에는 가족용 반려견으로 인기가 많습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('핏불 테리어', '대형', '적음', '많음', '활발하다', '영국', 'Pitbull_Terrier',
        '핏불 테리어(Pit Bull Terrier)는 대형견에 속하는 견종으로, 주로 격투견으로 사용되었던 역사를 가진견종입니다. 체구는 근육질이며, 머리는 크고 단단하며, 귀는 짧고 선명하게 세워져 있습니다. 눈은 작고 깊이 꽂혀 있으며, 코는 검은색이고 멋진 턱관절을 가지고 있습니다. 또한 핏불 테리어는 매우 활동적이며, 높은 운동량과 활동성을 유지해야 합니다');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('사모예드', '중형', '많음', '많음', '온순하다', '시베리아', 'Samoyed',
        '사모예드(Samoyed)는 원산지가 시베리아 북동부 지역이며, 겨울에는 추운 기후에서도 높은 체온을 유지할 수 있는 능력을 가지고 있는 중형견입니다. 사모예드는 아름다운 백색 털을 가지고 있으며, 특히 얼굴 주변의 털이 특징적입니다. 털은 겨울에는 두껍고 길지만 여름에는 얇아집니다. 따라서 겨울에는 매우 푹신하고 부드러운 털로 덮여 있습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('베들링턴 테리어', '중형', '적음', '보통', '온순하다', '영국', 'Bedlington_Terrier',
        '베들링턴 테리어(Bedlington Terrier)는 영국 출신의 작은 사냥개 겸 애완견으로, 외모상 늑대와 비슷한 모습을 가지고 있습니다. 아래는 베들링턴 테리어의 상세정보입니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('보더 콜리', '중형', '보통', '많음', '활발하다', '영국', 'Border_Collie',
        '보더 콜리(Border Collie)는 스코틀랜드 원산지의 개로, 소형~중형견에 속하며, 주로 양무리를 지키는 목적으로 사용되는 충실하고 지능적인 견종입니다. 보더 콜리는 영리하고 기민한 능력으로 높은 지능을 가진 스마트한 견종으로, 충실하고 활발한 성격을 가지고 있습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('래브라도 리트리버', '대형', '보통', '많음', '활발하다', '캐나다', 'Labrador_Retriever',
        '래브라도 리트리버(Labrador Retriever)는 세계적으로 가장 인기 있는 개 종 중 하나이며, 유명한 가정용 애완견으로도 자리매김하고 있습니다. 아래는 래브라도 리트리버의 상세 정보입니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('저먼 셰퍼드', '대형', '보통', '많음', '예민하다', '독일', 'German_Shepherd',
        '저먼 셰퍼드는 지능적이고 충성스러운 성격으로 알려진 대형견 종류 중 하나입니다. 높은 지능과 학습 능력을 가지고 있어 경찰견, 군용견, 구조견, 보안견 등으로 사용되며, 가족 반려견으로도 인기가 높습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('골든 리트리버', '대형', '보통', '보통', '활발하다', '스코틀랜드', 'Golden_Retriever',
        '골든 리트리버(Golden Retriever)는 영국에서 태어난 출혈개의 일종으로, 주로 사냥꾼들이 사용하기 위해 개량되었습니다. 지능적이고 사람을 좋아하며, 온순하고 친절한 성격으로 알려져 있습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('블러드하운드', '대형', '많음', '보통', '온순하다', '영국', 'Bloodhound',
        '블러드하운드는 주로 사냥용으로 사용되는 대형개로, 그 이름 그대로 냄새 추적 능력이 뛰어나며, 특히 형사나 경찰에서 수사나 수색용으로 많이 사용됩니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('도베르만 핀셔', '대형', '적음', '보통', '활발하다', '독일', 'Doberman_Pinscher',
        '도베르만 핀셔는 잘 알려진 것처럼 매우 용감하고 집요하며 지능적인 개입니다. 다른 많은 작업 개와 마찬가지로, 이들은 영리하고 배우기 쉽기 때문에 경찰 개, 군사 개, 수색 개, 가정 개 및 수의사의 보호 개로 광범위하게 사용됩니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('그레이 하운드', '대형', '적음', '많음', '온순하다', '영국', 'Greyhound',
        '그레이 하운드(Greyhound)는 매우 빠르고 우아한 외모가 특징적인 사냥개 종류입니다. 이들은 근육질이며 가늘고 길쭉한 체형을 갖고 있으며, 그레이색의 매끄러운 모직을 덮고 있습니다. 그레이 하운드는 수백 년 동안 사냥용으로 사용되어 왔으며, 이들은 빠른 속도와 우아한 움직임으로 유명합니다. 그레이 하운드는 사냥을 할 때 시각적인 자극에 반응하여 빠른 속도로 추격합니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('스탠다드 푸들', '대형', '적음', '보통', '활발하다', '프랑스', 'Standard_Poodle',
        '스탠다드 푸들은 체고가 45~60 cm인 경우다. 45cm는 최소 기준일 뿐이며, 체고가 60cm를 훨씬 넘어가는 경우도 많다. 때문에 스탠다드 푸들은 진돗개나 골든리트리버 같은 중대형견의 크기다.실제로 만나면 어느 개처럼 생긴 양이 목줄을 하고 돌아다니는 이상한 풍경을 볼 수 있다.물론 이는 사족보행만 할때의 얘기고 두발서기 하는 모습은 사람같아서 소름끼친다는 의견이 있다. 이는 다른 개들과 척추구조가 달라서 생기는 것으로, 두발서기를 할 때 푸들의 경우 가슴을 쭉 편채로 서있는 사람같은 구조가 된다. 두발로 일어서는 걸 넘어 사람처럼 앉거나 엎드리는 개체들도 존재한다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('복서', '중형', '보통', '많음', '활발하다', '독일', 'Boxer',
        '복서는 몸뚱아리가 크고 근육질인 외모와 달리, 사람과의 교감이 깊은 따뜻한 성격으로 알려져 있습니다. 매우 활발하고 똑똑하기 때문에 적극적인 활동이 필요합니다. 물론 적절한 교육과 규칙적인 운동이 제공된다면 가족과 잘 어울리며, 어린이와도 잘 지낼 수 있습니다.');
Insert into C##CONO.DOG (DOG_TYPE, DOG_SIZE, DOG_HAIR, DOG_STAMINA, DOG_CHAR, DOG_LOC, DOG_IMG, DOG_INFO)
values ('마스티프', '대형', '많음', '보통', '온순하다', '영국', 'Mastiff',
        '마스티프는 크고 근육질이며 강인한 몸뚱이와 짧은 모집털을 가진 견종으로, 주로 수수께끼 같은 표정으로 유명합니다. 그러나 대체로 침착하고 온화한 성격을 지니고 있어 가족들과 잘 어울리며, 특히 어린이와 잘 지내는 편입니다. 또한 주인에게 매우 충실하며, 보호 본능이 강하고 용감하기 때문에 경비견으로 사용되기도 합니다.');

commit;


