Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지가 가능한 높이 오줌을 누려고 하는 이유는 더 시원해서 이다 ?','X','높이 오줌을 눠야 내가 키가 큰 것 처럼 보여서 이다.
국 코넬대학교의 행동 생태학자인 베티 맥과이어가 뉴욕에 있는 한 동물 보호시설에 있는 45마리의 개가 어떻게 소변을 보나 관찰했습니다. 연구팀은 2년에 걸쳐서 700여 개의 자료를 수집했는데 그 결과를 요약하면 이렇습니다.
“개들의 소변 발사 각도에서 최저는 85도였고, 최고는 약 150도였다.”
그런데 어떤 개는 기를 쓰고 높이 오줌을 누었습니다. 연구팀에 따르면 이것은 일종의 ‘거짓말’입니다. 자기가 훨씬 키가 크고 덩치가 큰 것처럼 보이기 위해, 소변을 높이 눈다는 게 과학자들의 분석 결과입니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지가 사고를 치고 난 후 고개를 숙이고 눈을 피하며 낑낑 거리는 이유는 반성의 의미이다 ?','X','야단을 치면 반려견들이 반성을 한다고 사람들은 생각하죠. 그런데 아닙니다. 개는 반성의 능력이 없습니다. 후회와 죄책감은 개에게는 불가능한 감정인 것이죠. 미국의 신경과학자인 그레고리 번스 박사에 따르면 강아지가 고개를 숙이는 것은 갈등을 줄이는 방법입니다. 죄책감을 표현하는 것이 아닙니다. “당신이 강하고, 당신에게 덤빌 생각 없으니 싸우지 말자”라는 신호인 것입니다. ');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지의 필수 예방 접종은 6회이다 ?','O','강아지 필수 예방 접종은 생후 6주부터 16주까지 2주 간격으로 총 6회 실시합니다. 이후 심장 사상충과 외부 기생충 예방 접종을 월 1회 진행하는 것을 권장합니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지가 풀을 뜯어먹는 이유는 속이 좋지 않아서이다 ?','O','강아지들이 풀을 뜯어 먹는 가장 대표적인 이유는 바로 구토를 위해서이다. 특히 야생의 늑대들의 경우 속이 좋지 않을 때 풀을 뜯어 먹으면서 구토를 유발하는 경우가 많은데, 스스로 약을 먹을 수 없는 강아지의 입장에서 속이 불편하면 구토를 통해 이를 해결하는 것이 가장 좋은 방법이 아닐까 싶다. 반려견이 혹시 풀을 뜯어 먹는다면 변의 상태나 식사량 등을 한번 체크해 보는 것이 좋다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지의 평균 수명은 10~13년이다','O','보통 10년에서 13년 정도이지만, 일부 품종은 15년에서 20년 이상 살 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지의 가장 강력한 감각은 청각이다?','X','강아지의 가장 강력한 감각은 후각입니다.
강아지의 후각은 매우 강하며, 그들은 사물과 사람의 냄새를 인식하는 데 사용합니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지의 두 개의 이빨 사이에 있는 작은 이빨을 강아지 이빨이라고 한다?','O','이 작은 이빨은 "강아지 이빨"이라고하며, 강아지가 어른이 될 때까지 떨어지지 않습니다. 이 이빨은 유치를 유지하고 성장하는 동안 자리를 잡도록 도와줍니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지가 더위를 풀기 위해 사용하는 방법은 땀을 배출하는것이다 ?','X','강아지는 땀을 내지 않기 때문에, 입으로 숨을 내뱉어서 체온을 조절합니다. 따라서 강아지는 열을 내리기 위해 입을 벌리거나, 혀를 내밀어 숨을 내뱉는 것을 볼 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지가 사람보다 더 높은 곳으로 점프할 수 있다 ?','O','일부 강아지들은 높은 장애물을 넘을 수 있을 만큼 높이 뛸 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 흰 초콜릿을 먹어도 안전할까 ?','X','흰 초콜릿은 강아지에게 매우 위험한 식품 중 하나입니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 시력이 좋아서 밤에도 잘 볼 수 있다 ??','X','강아지는 시력이 좋지만, 밤에는 인간보다 시력이 약간 나빠집니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 높은 음성을 들을 수 있다 ?','O','일부 강아지는 높은 주파수의 소리를 들을 수 있으며, 이는 인간들이 듣기 어려운 범위에 속합니다.');
