Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 인간의 눈물을 알아차릴 수 있다 ?','O','아지는 인간의 눈물과 표정 변화를 인식할 수 있으며, 이를 통해 주인의 감정 상태를 파악할 수 있습니다.');
