Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 인간의 음성 톤을 구분할 수 있다?','O','강아지는 인간의 음성 톤을 구분할 수 있습니다. 따라서 우리가 강아지에게 명령을 내릴 때는 음성 톤이 일정해야 합니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 색맹이다 ?','X','강아지는 흑백 시력을 가지고 있지만, 일부 강아지는 일부 색상을 구별할 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 눈물을 흘리지 않는다 ?','X','강아지도 인간과 마찬가지로 눈물을 흘릴 수 있습니다. 눈물이 많은 강아지는 건강한 강아지이며, 눈물을 제대로 배출하지 못하면 강아지의 눈 건강에 문제가 생길 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지의 노란색 배변은 건강한 증거이다 ?','X','강아지의 배변물 색깔은 건강 상태를 나타내는 중요한 지표 중 하나입니다. 하지만 노란색 배변물은 강아지의 간 또는 췌장의 문제로 인해 발생할 수 있습니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 하루에 최소한 한 번 이상 산책을 나가야 합니다.','O','강아지는 매일 적어도 한 번 이상 산책을 나가야 합니다. 이는 강아지의 건강과 행복에 매우 중요한 요소입니다. 또한 강아지의 운동량은 강아지의 나이, 크기, 종류 등에 따라 다르기 때문에 적절한 운동량을 유지하는 것이 중요합니다.');
Insert into C##CONO.RANDOMQUIZ (RD_NUM,RD_QUIZ,RD_ANSWER,RD_EXPLAIN) values (RANDOMQUIZ_SEQ.nextval,'강아지는 자신의 털을 자기가 손질 할 수 있다 ?','X','강아지는 자신의 털을 자가 손질할 수 없습니다. 따라서 주인은 강아지의 털을 깨끗하게 유지하기 위해 브러싱 등의 적절한 관리를 해주어야 합니다.');

